from random import shuffle, choices, choice
import torch
import torch.nn as nn
from torch.nn import functional as F
from torch.utils.data import Dataset, DataLoader
from base64 import *

model = b''
with open('model.p', 'wb') as file:
    file.write(b64decode(model))

CHUNK_SIZE = 32
BATCH_SIZE = 256
BATCHES_IN_TRAIN = 8
BATCHES_IN_TEST = 2
TRAIN_SIZE = BATCH_SIZE * BATCHES_IN_TRAIN * 100
TEST_SIZE = BATCH_SIZE * BATCHES_IN_TEST
MIN_OCCURENCES = 10
MEMORY = 100
LAYERS = 2

def fmt(number):
    return '{:.5f}'.format(number)

alphabet = list(map(lambda x: chr(int(x)), '37 47 32 33 76 65 78 71 85 69 58 43 101 119 73 110 102 114 99 80 111 104 105 98 116 118 115 108 97 77 100 83 117 112 10 68 79 84 67 45 95 86 82 66 88 75 70 74 49 46 107 103 40 41 123 60 62 125 61 34 109 42 50 106 59 87 72 51 53 122 120 36 121 44 64 63 48 52 54 55 89 56 57 96 124 113 38 91 93 90 39 81 92'.split()))
ALPHABET_SIZE = len(alphabet)
print(f'alphabet = {alphabet}')


charToIndexMap = { c : i for i, c in enumerate(alphabet) }
def charToIndex(c):
    return torch.as_tensor(charToIndexMap.get(c, ALPHABET_SIZE - 1), dtype=torch.long)

def stringToTensor(cur):
    x = torch.zeros(size=(len(cur), ALPHABET_SIZE))
    for j in range(len(cur)):
        x[j][charToIndex(cur[j])] = 1
    return x

class StringDataset(Dataset):
    def __init__(self, strings):
        super(StringDataset, self).__init__()
        self.strings = strings
    def __len__(self):
        return len(self.strings)
    def __getitem__(self, i):
        return stringToTensor(self.strings[i])

def guessNext(predictor, text):
    if len(text) > 100:
        text = text[len(text)-100:]
    data = stringToTensor(text).view(1, -1, ALPHABET_SIZE)
    h0 = torch.randn((LAYERS, 1, ALPHABET_SIZE + MEMORY))
    output = predictor(data, h0)[0][:, -1, :]
    output = output[0, :ALPHABET_SIZE]
    return output

def guessNextK(predictor, prefix, k):
    print(prefix, end='', flush=True)
    for it in range(k):
        p = guessNext(predictor, prefix)
        if len(prefix) >= 10 and all(c in ' \t\n' for c in prefix[len(prefix)-10:]):
            p[charToIndex(' ')] = 0
            p[charToIndex('\t')] = 0
            p[charToIndex('\n')] = 0
        p *= 100
        p = p.softmax(dim=-1)
        p = list(p.detach().numpy())
        c = choices(alphabet, weights=p, k=1)[0]
        prefix += c
        print(c, end='', flush=True)
    print(flush=True)

predictor = nn.GRU(input_size=ALPHABET_SIZE,
                   hidden_size=ALPHABET_SIZE+MEMORY,
                   num_layers=LAYERS,
                   bias=True,
                   batch_first=True,
                   dropout=0,
                   bidirectional=False)
predictor.load_state_dict(torch.load('model.p'))

while True:
    s = input()
    guessNextK(predictor, s, 1000)